import { createStore } from 'redux'

function todos(state = {}, action) {
    switch (action.type) {
        case 'ADD_TODO':
            return state.todos.concat([action.text])
        case 'CHANGE_LIST':
            state.CurrentList = action.text
            return state
        default:
            return state
    }
}
let store = ""
var getTasks = () => {
